  false,\n\t\"url\": null,\n\t\"notes\": \"Alaska Department of Fish and Game (ADF&G)
  conducted Fall aerial duck surveys on the Copper River Delta between late August
  and late October in 1980 and 1981 to identify waterfowl species composition, areas
  of concentrated use, and the relative abundance of ducks by weekly time periods,
  location, and general habitat type. This report summarizes the results of those
  surveys.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
